import React, { Component } from 'react';
import Inputs from '../components/input';

class form extends Component {
    render() {
        return (
            <div className="container">
                <div className="row justify-content-center">
                    <div className="col-6 ">
                    <form>
                        <Inputs />
                        <button type="submit" onClick={this.handleSubmit} className="btn btn-primary">Crear Tarea</button>
                    </form>
                    </div>
                </div>
            </div>
        );
    }
}

export default form;
